<!doctype html>
<html class="staticrypt-html">
    <head>
        <meta charset="utf-8">
        <title>Kryptert side</title>
        <meta name="viewport" content="width=device-width, initial-scale=1">

        <!-- do not cache this page -->
        <meta http-equiv="cache-control" content="max-age=0"/>
        <meta http-equiv="cache-control" content="no-cache"/>
        <meta http-equiv="expires" content="0"/>
        <meta http-equiv="expires" content="Tue, 01 Jan 1980 1:00:00 GMT"/>
        <meta http-equiv="pragma" content="no-cache"/>

        <style>
         .staticrypt-hr {
             margin-top: 20px;
             margin-bottom: 20px;
             border: 0;
             border-top: 1px solid #eee;
         }

         .staticrypt-page {
             width: 360px;
             padding: 8% 0 0;
             margin: auto;
             box-sizing: border-box;
         }

         .staticrypt-form {
             position: relative;
             z-index: 1;
             background: #FFFFFF;
             max-width: 360px;
             margin: 0 auto 100px;
             padding: 45px;
             text-align: center;
             box-shadow: 0 0 20px 0 rgba(0, 0, 0, 0.2), 0 5px 5px 0 rgba(0, 0, 0, 0.24);
         }

         .staticrypt-form input {
             outline: 0;
             background: #f2f2f2;
             width: 100%;
             border: 0;
             margin: 0 0 15px;
             padding: 15px;
             box-sizing: border-box;
             font-size: 14px;
         }

         .staticrypt-form .staticrypt-decrypt-button {
             /* text-transform: uppercase; */
             outline: 0;
             background: #4168A0;
             width: 100%;
             border: 0;
             padding: 15px;
             color: #FFFFFF;
             font-size: 14px;
             cursor: pointer;
         }

         .staticrypt-form .staticrypt-decrypt-button:hover, .staticrypt-form .staticrypt-decrypt-button:active, .staticrypt-form .staticrypt-decrypt-button:focus {
             background: #4169E1;
         }

         .staticrypt-html {
             height: 100%;
         }

         .staticrypt-body {
             margin-bottom: 1em;
             background: #5bbad5; /* fallback for old browsers */
             background: -webkit-linear-gradient(right, #5bbad5, #5bbae6);
             background: -moz-linear-gradient(right, #5bbad5, #5bbae6);
             background: -o-linear-gradient(right, #5bbad5, #5bbae6);
             background: linear-gradient(to left, #5bbad5, #5bbae6);
             font-family: "Bookman", sans-serif;
             -webkit-font-smoothing: antialiased;
             -moz-osx-font-smoothing: grayscale;
         }

         .staticrypt-instructions {
             margin-top: -1em;
             margin-bottom: 1em;
         }

         .staticrypt-title {
             font-size: 1.5em;
         }

         .staticrypt-subtitle {
             font-family: "Times New Roman", Times, serif;
             font-size: 0.9em;
             font-style: italic;
         }

         .staticrypt-footer {
             position: fixed;
             height: 20px;
             font-size: 16px;
             padding: 2px;
             bottom: 0;
             left: 0;
             right: 0;
             margin-bottom: 0;
         }

         .staticrypt-footer p {
             margin: 2px;
             text-align: center;
             float: right;
             font-size: 0.5em;
         }

         .staticrypt-footer a {
             text-decoration: none;
         }
        </style>
    </head>

    <body class="staticrypt-body">
        <div class="staticrypt-page">
            <div class="staticrypt-form">
                <div class="staticrypt-instructions">
                    <p class="staticrypt-title">Stavanger</p>
                    <p class="staticrypt-subtitle">Sykehusrapport for 2018 data</p>
                </div>

                <hr class="staticrypt-hr">

                <form id="staticrypt-form" action="#" method="post">
                    <input id="staticrypt-password"
                           type="password"
                           name="password"
                           placeholder="passord"
                           autofocus/>

                    <input type="submit" class="staticrypt-decrypt-button" value="Logg pÃ¥"/>

                </form>
                <div>
                    <a class="staticrypt-subtitle" href="https://bdreg.github.io/">Tilbake til BDR</a>
                </div>
            </div>

        </div>
        <footer class="staticrypt-footer">
            <p class="pull-right">Lages med <a href="https://robinmoisson.github.io/staticrypt">StatiCrypt</a></p>
        </footer>
